:text: |
  Descendants of WILLIAMS, Henry and COLDHAM, Marianne
  JWILLIAMS, John William and BUSBY, Sarah
  JWILLIAMS, Percy Temple and PIERCE, Mary Isobel
  JWILLIAMS, Patrick Heathcote Temple and STRACK, Monica Jean
  JWILLIAMS, Rosemary Anne and HEDGE, Brian James
  02> HEDGE, Anna Louise
  b 15.05.1980
  Anna b. at Howick, Auckland. As a great great great granddaughter of Henry Williams and James Busby
  and a direct descendant of a Treaty signatory, Anna was chosen to present a bouquet to the Queen at
  the Waitangi Celebrations, 1990.
  03> HEDGE, Nicola Mary
  b 06.11.1982
  02> WILLIAMS, Susan Temple m on 19.12.1981 to GIBSON, John Llewellyn
  b 03.12.1953
  b 05.06.1951
  Susan continues to be known by the surname, Williams. Address: 32 Jacksons Road, Fendalton,
  Christchurch.
  Susan was educated at St Margaret's College, Christchurch (1958-70) and Canterbury University (BA) and
  is a secondary school teacher in Christchurch.
  John is a senior town planner in Christchurch.
  01> GIBSON, Nicholas John Llewellen
  b 06.10.1990
  Nicholas b. at Christchurch.
  02> GIBSON, Margot Lucy Marianne
  b 22.06.1994
  Margot b. at Christchurch.
  03> WILLIAMS, Christopher John Pierce
  b 16.08.1955
  Christopher b. at Christchurch. Address: 6 Desmond Street, Fendalton, Christchurch.
  Christopher was educated at Christ's College (1968-72, Head of House 1972, Somes Scholar), Canterbury
  University (MA) and London University (MA). He is a teacher at Christ's College, and is the Housemaster
  of Corfe House..
  02> WILLIAMS, Mary Temple
  b 02.02.1912 d 31.12.1993
  Mary b. at St John's College, Auckland. She was a well-known Painia character and keenly supported many
  Williams family activities. Until her death, Mary lived in the house built by her father in Paihia. The
  property has significant historical value and its future is currently being debated.
  07> WILLIAMS, John William (Jack) m on 11.05.1899 to WILLIAMSON, Jessie Mackie
  b 11.12.1867 d 13.12.1950
  b 26.08.1876 d 20.12.1947
  John b. at Pakaraka, Bay of Islands, Jessie, d/o G M Williamson (a Gisborne farmer),
  b. at Matamata.
  Jack was educated at Christ's College, Christchurch (1883-86) and went to Scotland
  where he gained his MB, CM(Edin) in 1891 and MD in 1898. He served as a medical
  officer with the Melanesian Mission in the Solomon Islands (1895-97). During WWI he
  was Captain NZMC, 22nd Reinforcements NZEF then Major NZMC (retd) and later he was a
  doctor at Walton-on-Thames, England.
  Back in New Zealand he was a medical practitioner in Gisborne and served as maternity superintendent at Cook
  Hospital, He was also a warden at Holy Trinity Anglican Church, Gisborne. Their home was at 25 Fitzherbert
  Street, Gisborne.
